import { createSlice } from '@reduxjs/toolkit';

// Get storage key with consistent ID from localStorage
const getStorageKey = (key) => {
  // Check if PAGE_INSTANCE_ID exists and is from localStorage (not newly generated)
  // Use simple key names without appending instance ID to ensure finding the same key when refreshing the page
  return key;
};

// Safe method to get values from localStorage
const safeGetItem = (key) => {
  try {
    return localStorage.getItem(getStorageKey(key));
  } catch (error) {
    return null;
  }
};

// Safe method to set values in localStorage
const safeSetItem = (key, value) => {
  try {
    localStorage.setItem(getStorageKey(key), value);
  } catch (error) {
    // Error silently handled
  }
};

// Safe method to remove values from localStorage
const safeRemoveItem = (key) => {
  try {
    localStorage.removeItem(getStorageKey(key));
  } catch (error) {
    // Error silently handled
  }
};

const initialState = {
  token: safeGetItem('token') || null,
  userType: safeGetItem('userType') || null,
  userName: safeGetItem('userName') || 'Admin',
  isAuthenticated: !!safeGetItem('token'),
  loading: false,
  error: null
};

const authSlice = createSlice({
  name: 'auth',
  initialState,
  reducers: {
    loginStart: (state) => {
      state.loading = true;
      state.error = null;
    },
    loginSuccess: (state, action) => {
      state.token = action.payload.token;
      state.userType = action.payload.userType;
      state.userName = action.payload.userName || 'Admin';
      state.isAuthenticated = true;
      state.loading = false;
      state.error = null;

      // Save to localStorage
      safeSetItem('token', action.payload.token);
      safeSetItem('userType', action.payload.userType);
      safeSetItem('userName', action.payload.userName || 'Admin');
    },
    loginFailure: (state, action) => {
      state.loading = false;
      state.error = action.payload;
    },
    logout: (state) => {
      state.token = null;
      state.userType = null;
      state.userName = null;
      state.isAuthenticated = false;

      // Clear authentication information from localStorage
      safeRemoveItem('token');
      safeRemoveItem('userType');
      safeRemoveItem('userName');
    }
  }
});

export const { loginStart, loginSuccess, loginFailure, logout } = authSlice.actions;

export default authSlice.reducer;

import { Routes, Route, Navigate, useNavigate } from 'react-router-dom';
import { useSelector, useDispatch } from 'react-redux';
import { useState, useEffect, lazy, Suspense } from 'react'
import reactLogo from './assets/react.svg'
import viteLogo from '/vite.svg'
import './App.css'
import { logout } from './store/authSlice';
import { message } from 'antd';

const LandingPage = lazy(() => import('./pages/LandingPage'));
const Login = lazy(() => import('./pages/Login'));
const Register = lazy(() => import('./pages/Register'));
const VerifyCode = lazy(() => import('./pages/VerifyCode'));
const CompleteProfile = lazy(() => import('./pages/CompleteProfile'));
const LinkGoogleAccount = lazy(() => import('./pages/LinkGoogleAccount'));

const AdminDashboard = lazy(() => import('./pages/admin/Dashboard'));
const CoachDashboard = lazy(() => import('./pages/coach/Dashboard'));
const CoachDetails = lazy(() => import('./pages/coach/Details'));
const MemberDashboard = lazy(() => import('./pages/member/Dashboard'));
import { DndProvider } from 'react-dnd';
import { HTML5Backend } from 'react-dnd-html5-backend';

const LoadingComponent = () => (
  <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100vh' }}>
    <div>Loading page...</div>
  </div>
);

const ProtectedRoute = ({ children, requiredUserType = null }) => {
  const { isAuthenticated, userType } = useSelector((state) => state.auth);
  const [isChecking, setIsChecking] = useState(true);

  useEffect(() => {
    const timer = setTimeout(() => {
      setIsChecking(false);
    }, 50);
    return () => clearTimeout(timer);
  }, [isAuthenticated, userType]);

  if (!isAuthenticated && !isChecking) {
    return <Navigate to="/login" replace />;
  }

  if (isAuthenticated && requiredUserType && userType !== requiredUserType && !isChecking) {
    switch (userType) {
      case 'admin':
        return <Navigate to="/admin/dashboard" replace />;
      case 'member':
        return <Navigate to="/member/dashboard" replace />;
      case 'coach':
        return <Navigate to="/coach/dashboard" replace />;
      default:
        return <Navigate to="/" replace />;
    }
  }

  if (isChecking) {
    return <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100vh' }}>
      <div>Verifying identity...</div>
    </div>;
  }

  return children;
};

function App() {
  const [count, setCount] = useState(0)
  const { isAuthenticated } = useSelector((state) => state.auth);
  const dispatch = useDispatch();
  const navigate = useNavigate();

  useEffect(() => {
    if (isAuthenticated) {
      const tokenExpirationKey = 'tokenExpirationHandled';
      sessionStorage.removeItem(tokenExpirationKey);

      const originalFetch = window.fetch;
      window.fetch = async function(...args) {
        if (sessionStorage.getItem(tokenExpirationKey) === 'true') {
          return originalFetch.apply(this, args);
        }

        try {
          const response = await originalFetch.apply(this, args);

          if (sessionStorage.getItem(tokenExpirationKey) === 'true') {
            return response;
          }

          const clonedResponse = response.clone();

          clonedResponse.json().then(data => {
            if (data && data.code === 3000 && data.msg === 'Not logged in or login expired') {
              if (sessionStorage.getItem(tokenExpirationKey) === 'true') {
                return;
              }

              sessionStorage.setItem(tokenExpirationKey, 'true');

              localStorage.removeItem('token');
              localStorage.removeItem('userType');
              localStorage.removeItem('userName');

              dispatch(logout());

              if (!window.location.pathname.includes('/login')) {
                navigate('/login', { 
                  replace: true,
                  state: { 
                    expired: true
                  }
                });
              }
            }
          }).catch(err => {
          });

          return response;
        } catch (error) {
          return Promise.reject(error);
        }
      };

      return () => {
        window.fetch = originalFetch;
      };
    }
  }, [isAuthenticated, dispatch, navigate]);

  return (
    <DndProvider backend={HTML5Backend}>
      <Routes>
        <Route path="/verify-code" element={
          <Suspense fallback={<LoadingComponent />}>
            <VerifyCode />
          </Suspense>
        } />
        <Route path="/login" element={
          <Suspense fallback={<LoadingComponent />}>
            <Login />
          </Suspense>
        } />
        <Route path="/register" element={
          <Suspense fallback={<LoadingComponent />}>
            <Register />
          </Suspense>
        } />
        <Route path="/complete-profile" element={
          <Suspense fallback={<LoadingComponent />}>
            <CompleteProfile />
          </Suspense>
        } />
        <Route path="/link-google-account" element={
          <Suspense fallback={<LoadingComponent />}>
            <LinkGoogleAccount />
          </Suspense>
        } />
        <Route path="/" element={
          <Suspense fallback={<LoadingComponent />}>
            <LandingPage />
          </Suspense>
        } />

        <Route
          path="/admin/dashboard"
          element={
            <ProtectedRoute requiredUserType="admin">
              <Suspense fallback={<LoadingComponent />}>
                <AdminDashboard />
              </Suspense>
            </ProtectedRoute>
          }
        />

        <Route
          path="/member/dashboard"
          element={
            <ProtectedRoute requiredUserType="member">
              <Suspense fallback={<LoadingComponent />}>
                <MemberDashboard />
              </Suspense>
            </ProtectedRoute>
          }
        />
        <Route
          path="/member/coaches"
          element={
            <ProtectedRoute requiredUserType="member">
              <Suspense fallback={<LoadingComponent />}>
                <MemberDashboard initialActiveMenu="coaches" />
              </Suspense>
            </ProtectedRoute>
          }
        />
        <Route
          path="/member/booking"
          element={
            <ProtectedRoute requiredUserType="member">
              <Suspense fallback={<LoadingComponent />}>
                <MemberDashboard initialActiveMenu="booking" />
              </Suspense>
            </ProtectedRoute>
          }
        />
        <Route
          path="/member/subscription-requests"
          element={
            <ProtectedRoute requiredUserType="member">
              <Suspense fallback={<LoadingComponent />}>
                <MemberDashboard initialActiveMenu="subscription-requests" />
              </Suspense>
            </ProtectedRoute>
          }
        />
        <Route
          path="/member/session-requests"
          element={
            <ProtectedRoute requiredUserType="member">
              <Suspense fallback={<LoadingComponent />}>
                <MemberDashboard initialActiveMenu="session-requests" />
              </Suspense>
            </ProtectedRoute>
          }
        />
        <Route
          path="/member/schedule"
          element={
            <ProtectedRoute requiredUserType="member">
              <Suspense fallback={<LoadingComponent />}>
                <MemberDashboard initialActiveMenu="schedule" />
              </Suspense>
            </ProtectedRoute>
          }
        />
        <Route
          path="/member/history"
          element={
            <ProtectedRoute requiredUserType="member">
              <Suspense fallback={<LoadingComponent />}>
                <MemberDashboard initialActiveMenu="history" />
              </Suspense>
            </ProtectedRoute>
          }
        />

        <Route
          path="/coach/dashboard"
          element={
            <ProtectedRoute requiredUserType="coach">
              <Suspense fallback={<LoadingComponent />}>
                <CoachDashboard />
              </Suspense>
            </ProtectedRoute>
          }
        />
        <Route
          path="/coach/details"
          element={
            <ProtectedRoute requiredUserType="coach">
              <Suspense fallback={<LoadingComponent />}>
                <CoachDetails />
              </Suspense>
            </ProtectedRoute>
          }
        />
        <Route
          path="/coach/session-requests"
          element={
            <ProtectedRoute requiredUserType="coach">
              <Suspense fallback={<LoadingComponent />}>
                <CoachDashboard initialActiveMenu="session-requests" />
              </Suspense>
            </ProtectedRoute>
          }
        />
        <Route
          path="/coach/subscription-requests"
          element={
            <ProtectedRoute requiredUserType="coach">
              <Suspense fallback={<LoadingComponent />}>
                <CoachDashboard initialActiveMenu="subscription-requests" />
              </Suspense>
            </ProtectedRoute>
          }
        />
        <Route
          path="/coach/requests"
          element={
            <ProtectedRoute requiredUserType="coach">
              <Suspense fallback={<LoadingComponent />}>
                <CoachDashboard initialActiveMenu="requests" />
              </Suspense>
            </ProtectedRoute>
          }
        />

        <Route
          path="/coach/schedule"
          element={
            <ProtectedRoute requiredUserType="coach">
              <Suspense fallback={<LoadingComponent />}>
                <CoachDashboard initialActiveMenu="schedule" />
              </Suspense>
            </ProtectedRoute>
          }
        />

        <Route
          path="/coach/availability"
          element={
            <ProtectedRoute requiredUserType="coach">
              <Suspense fallback={<LoadingComponent />}>
                <CoachDashboard initialActiveMenu="availability" />
              </Suspense>
            </ProtectedRoute>
          }
        />

        <Route
          path="/coach/unrecorded-sessions"
          element={
            <ProtectedRoute requiredUserType="coach">
              <Suspense fallback={<LoadingComponent />}>
                <CoachDashboard initialActiveMenu="unrecorded-sessions" />
              </Suspense>
            </ProtectedRoute>
          }
        />

        <Route path="*" element={<Navigate to="/" replace />} />
      </Routes>
    </DndProvider>
  )
}

export default App

import { createSlice } from '@reduxjs/toolkit';

/**
 * Navigation state management slice
 * Used to manage the active state of the sidebar menu
 */
const navSlice = createSlice({
  name: 'navigation',
  initialState: {
    activeMenu: 'dashboard' // Default active menu is 'dashboard'
  },
  reducers: {
    // Set current active menu
    setActiveMenu: (state, action) => {
      state.activeMenu = action.payload;
    }
  }
});

export const { setActiveMenu } = navSlice.actions;
export default navSlice.reducer;

import { createApi, fetchBaseQuery } from '@reduxjs/toolkit/query/react';
import { message } from 'antd';
import { logout } from '../authSlice';

// Get storage key without adding instance ID suffix
const getStorageKey = (key) => {
  // Use simple key names without appending instance ID to ensure token can be found after page refresh
  return key;
};

// Safe method to get values from localStorage
const safeGetItem = (key) => {
  try {
    return localStorage.getItem(getStorageKey(key));
  } catch (error) {
    return null;
  }
};

// Safe method to remove items from localStorage
const safeRemoveItem = (key) => {
  try {
    localStorage.removeItem(getStorageKey(key));
  } catch (error) {
    // Error silently handled
  }
};

// Function to handle token expiration
const handleTokenExpiration = (api) => {
  // Prevent duplicate handling, use a flag to avoid multiple calls
  if (window.__handlingTokenExpiration) {
    return;
  }

  // Set flag to prevent duplicate handling
  window.__handlingTokenExpiration = true;

  // Clear local storage
  safeRemoveItem('token');
  safeRemoveItem('userType');
  safeRemoveItem('userName');

  // Trigger Redux logout action
  api.dispatch(logout());

  // Display message to user
  message.error({
    content: 'Your session has expired. Please login again.',
    duration: 5,
    style: {
      marginTop: '20vh',
      fontSize: '16px',
      fontWeight: 'bold'
    }
  });

  // Redirect to login page
  setTimeout(() => {
    window.location.href = '/login';
    // Reset handling flag
    setTimeout(() => {
      window.__handlingTokenExpiration = false;
    }, 1000);
  }, 2000);
};

// Create a base query
const baseQuery = fetchBaseQuery({
  baseUrl: process.env.NODE_ENV === 'production' 
    ? '/' 
    : 'http://localhost:8080',
  prepareHeaders: (headers, { endpoint }) => {
    // Check if this is an endpoint that doesn't need a token
    const noTokenEndpoints = ['login', 'sendVerificationCode', 'verifyCode', 'resendVerificationCode', 'completeProfile', 'linkGoogleAccount'];
    if (noTokenEndpoints.includes(endpoint)) {
      return headers;
    }

    // Get token from localStorage (using safe method)
    const token = safeGetItem('token');

    if (token) {
      // Only set token header, remove Authorization header
      headers.set('token', token);
    }
    return headers;
  },
});

// Create a wrapped baseQuery to handle token expiration
const baseQueryWithReauth = async (args, api, extraOptions) => {
  const result = await baseQuery(args, api, extraOptions);

  // Check for errors
  if (result.error) {
    // Extract data from error
    const errorData = result.error.data;

    // Check if it's a token expiration error
    if (errorData) {
      const { code, msg, data } = errorData;

      // Extended error code detection, compatible with multiple expiration scenarios
      const isTokenExpired = 
        (code === 3000) || 
        (code === 401) || 
        (msg === 'Not logged in or login expired') ||
        (msg && msg.toLowerCase().includes('token expired')) ||
        (msg && msg.toLowerCase().includes('invalid token')) ||
        (data && typeof data === 'string' && data.includes('authentication is required'));

      if (isTokenExpired) {
        // Call local handling function directly
        handleTokenExpiration(api);
      }
    }
  }

  return result;
};

// Create base API configuration
export const baseApi = createApi({
  reducerPath: 'api',
  baseQuery: baseQueryWithReauth,
  // Common tag types
  tagTypes: ['User', 'Auth', 'Coach', 'MemberSubscriptionRequests', 'MemberUnreadCount'],
  // Endpoints will be defined in specific API slices
  endpoints: () => ({}),
});

import { configureStore } from '@reduxjs/toolkit';
import authReducer from './authSlice';
import navReducer from './navSlice';
import { baseApi } from './api/baseApi';
import { setupListeners } from '@reduxjs/toolkit/query';

// Generate unique namespace to prevent sharing Redux state across multiple tabs
const getStoreNamespace = () => {
  if (typeof window !== 'undefined' && window.PAGE_INSTANCE_ID) {
    return `store_${window.PAGE_INSTANCE_ID}`;
  }
  return 'default_store';
};

export const store = configureStore({
  reducer: {
    auth: authReducer,
    navigation: navReducer,
    // Add RTK Query API Reducer
    [baseApi.reducerPath]: baseApi.reducer,
    // Add other reducers as needed
  },
  // Add RTK Query middleware
  middleware: (getDefaultMiddleware) =>
    getDefaultMiddleware().concat(baseApi.middleware),
  devTools: {
    name: getStoreNamespace()
  }
});

// Optional but strongly recommended for refetchOnFocus/refetchOnReconnect features
setupListeners(store.dispatch);

export default store;
